<!DOCTYPE html>
<html>

<head>

    <title>Mercantil - Template - PDF</title>

    <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css"
        integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T" crossorigin="anonymous">
    <meta charset="UTF-8">
</head>

<body>

    <div class=container-fluid>
        <div class=row>


            <div class="col-md-1 hidden-sm hidden-xs"></div>


            <!-- FORMULARIO -->
            <div class="col-md-5">
                <h1>
                    <b><span style="text-decoration: underline">PDF</span></b>
                </h1>
                <br>

                <div align="center">
                    <table class="table table-striped" style="width: 100%">
                        <thead>
                            <tr class="bg-primary" class="text-primary" style="text-align: left;">
                                <th><i class="glyphicon glyphicon-log-in"></i>&nbsp;&nbsp;&nbsp;PDF</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>
                                    <div class="form-group">
                                        <label>Tamaño</label>
                                        <div class='input-group text'>
                                            <span class="input-group-addon">
                                                <span class="glyphicon glyphicon-user"></span>
                                            </span>

                                            <select class="form-control col-md-12" id="hoja">
                                                <option selected>Eliga</option>
                                                <option value="0">Carta</option>
                                                <option value="1">Media Carta</option>
                                                <option value="2">Bolsillo</option>
                                            </select>
                                        </div>
                                    </div>

                                    <div class="form-group">
                                        <label>Nombre</label>
                                        <div class='input-group text'>
                                            <span class="input-group-addon">
                                                <span class="glyphicon glyphicon-user"></span>
                                            </span>

                                            <input maxlength="20" id="name" type="text" class="form-control" name="name"
                                                value="" placeholder="Ingrese su nombre">
                                        </div>
                                    </div>


                                    <div class="form-group col-md-12">
                                        <label>CI</label>
                                        <div class='input-group text'>

                                            <select class="form-control col-md-1" id="nacionalidad">
                                                <option selected> </option>
                                                <option value="V">V</option>
                                                <option value="J">J</option>
                                                <option value="E">E</option>
                                                <option value="P">P</option>
                                                <option value="G">G</option>
                                                <option value="R">R</option>
                                            </select>

                                            <span class="input-group-addon">
                                                <span class="glyphicon glyphicon-user"></span>
                                            </span>

                                            <input maxlength="20" id="cedula" type="text" class="form-control col-md-11"
                                                value="" name="cedula" placeholder="Ingrese su cédula">
                                        </div>
                                    </div>

                                    <div class="form-group">
                                        <label>Número de Celular</label>
                                        <div class='input-group text'>
                                            <span class="input-group-addon">
                                                <span class="glyphicon glyphicon-user"></span>
                                            </span>

                                            <input maxlength="20" id="celular" type="text" class="form-control" value=""
                                                name="celular" placeholder="Ingrese su número telefonico">
                                        </div>
                                    </div>

                                    <div class="form-check">
                                        <label class="form-check-label">&nbsp;</label>
                                    </div>

                                    <input id="generatepdf" type=button class="btn btn-primary" value="Generar Pdf "
                                        onclick="myFunction()" />
                                    <input id="downloadpdf" type=button class="btn btn-primary"
                                        value="Descargar Pdf " />
                                </td>
                            </tr>
                        </tbody>
                    </table>
                </div>
            </div>
            <!-- FORMULARIO -->



            <!-- PREVIEW-->

            <div class=col-md-5>
                <div align="center" style="float: right; height: 650px; width: 99%;">
                    <div id="preview-panel"
                        style="height: 650px;position:relative; z-index:999; border: 3px solid #ccc;"></div>

                </div>
                <!-- ****************************************** -->
                <!-- ********** Fin contenido interno ********* -->
                <!-- ****************************************** -->

            </div>
            <!-- PREVIEW-->



        </div>
    </div>
    <div class=col-sm-1>
        <div class=compartir>
            <!-- AddToAny BEGIN -->
            <div class="a2a_kit a2a_kit_size_24 a2a_default_style"><a class=a2a_dd></a>
            </div>
        </div>
    </div>
